import React from 'react';
import styled from 'styled-components';
import AboutSection from '../components/AboutSection';
import ServicesSection from '../components/ServicesSection';
import ProjectsSectionTerminer from '../components/ProjectsSectionTerminer';
import ContactBanner from '../components/ContactBanner';
import HeroSection from '../components/HeroSection';
import ProjectsSectionAvant from '../components/ProjectsSectionAvant';
import ProjectsSectionEncours from '../components/ProjectsSectionEncours';

const HeroStyless = styled.div`
  .hero__img {
    max-width: 1500px;
    width: 100%;
    height: 450px;
    margin: 0 auto;
    border: 2px solid var(--verte);
    position: fixed;
    opacity: 0, 5;
    background-image: url('http://127.0.0.1:8000/media/cuisine.jpeg');
  }

  @media only screen and (max-width: 768px) {
    .hero__img {
      height: 400px;
    }
  } ;
`;

export default function Home() {
  return (
    <HeroStyless>
      <div className="hero_img">
        <AboutSection />
        <ServicesSection />
        <ProjectsSectionAvant />
        <ProjectsSectionEncours />
        <ProjectsSectionTerminer />
        <ContactBanner />
      </div>
    </HeroStyless>
  );
}
